import React from "react";
import { Link } from "react-router-dom";

function Error() {
   return (
      <div
         style={{
            backgroundImage: `url(${Image})`,
            width: "100%",
            height: "1000px",
         }}>
         ><h1>PAGE NOT FOUND</h1>
         <br />
         <Link to='/home'>
            <button name='volver'>Volver para estar seguro</button>
         </Link>
      </div>
   );
}

export default Error;
